import React ,{useState} from 'react'
import Hero from "./User.module.css";

let x=0;
function User (){
    let arr=[

            {   
            profile:"data:image/jpeg;base64,",
            name:"Captain America",
            age:250
            },

            {
            profile:"data:image/png;base64,",
            name:"Iron Man",
            age:50
             },

             {
                profile:"data:image/jpeg;base64,",
                name:"Miss Marvel",
                age:150
            },

            {
                profile:"data:image/jpeg;base64,",
                name:"Hulk",
                age:170
            },

            {
                profile:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTIOHDVd9MpCvbAISsYihVX7a1EB75Z5iKSWA&s",
                name:"Valkairy",
                age:200
            },
            
            {
                profile:"https://upload.wikimedia.org/wikipedia/en/3/3c/Chris_Hemsworth_as_Thor.jpg",
                name:"Thor",
                age:200
            },
            
            {
                profile:"https://i.ytimg.com/vi/R99wb2NTNag/maxresdefault.jpg",
                name:"Black Panthar",
                age:200
            },
            
            {
                profile:"https://upload.wikimedia.org/wikipedia/en/f/fc/Paul_Bettany_as_Vision.jpg",
                name:"Vision",
                age:200
            },
                        
            {
                profile:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSfhC922XlhwA2-yUXwzROHQ1_5VvlFNK5CXg&s",
                name:"Black Widow",
                age:200
            },
                      
            {
                profile:"https://static1.colliderimages.com/wordpress/wp-content/uploads/2023/02/ant-man-paul-rudd.jpg",
                name:"Ant-man",
                age:200
            },

    ]
    
        let [index, setIndex] = useState(0); // Track the index instead of x
        const [user, setUser] = useState(arr[0]);
      
        const changeUser = () => {
          const newIndex = (index + 1) % arr.length; 
          setIndex(newIndex);
          setUser(arr[newIndex]);
        };
  return (
    <div>
            <div className={Hero.body}>
            <img className={Hero.img} src={user?.profile} alt="" height={200} width={250}/>
            <h3>Name:{user.name}</h3>
            <h3>Age:{user.age}</h3>
            <button className={Hero.btn} onClick={changeUser}>Change Avenger</button>
            </div>

    </div>


  );
};

export default User